  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Catherine (Kate) and HADFIELD. Octavius
  JHADFIELD, Henry Samuel and TUCKEY, Elizabeth Rhodes
  JHADFIELD, Gordon Horatio and GRAY, Maisie Dunbar
  JHADFIELD, Henry Barry Gray and HOWELL, Nina Millicent
  01> HADFIELD, Elisabeth Andrea
  b 31.05.1949
  Andrea graduated Bachelor of Business Studies majoring in sports management and coaching in 1996.
  She is involved with College Rifles and Auckland netball administration and is working as practice
  manager for Blackmore Virtue and Owens in Newmarket, Auckland.
  02> HADFIELD, David Carleton m on 03.04.1975 to HEWITT, Mary Ellen
  b 21.10.1951
  b ** ** ****
  Address: "Kelmarsh", Old Valley Road, Paraparaumu.
  David graduated BA and MA in Psychology and is a lecturer at Massey University. He has been a
  professional cricket coach for the Horowhenua Cricket Association and Coaching Director for the
  Central Districts Cricket Association and he currently coaches in Manawatu. A keen musician, he
  released a record about the farming slump entitled "Man of the Land".
  01> HADFIELD, Melissa Maisie
  b 15.11.1976
  Melissa b. at Paraparaumu. She was educated at Paraparaumu Primary School and Paraparaumu
  College and is currently completing a degree in Business Studies majoring in Human Resource
  Management at Massey University.
  02> HADFIELD, Richard Henry
  b 24.02.1978
  Richard b. at Paraparaumu. He was educated at Paraparaumu Primary School and Paraparaumu
  College and is currently completing a degree in Business Studies majoring in Enterprise
  Development.
  03> HADFIELD, Samuel Mark
  b 17.04.1982
  Samuel b. at Paraparaumu. He was educated at Paraparaumu Primary School and is now at
  Paraparaumu College.
  03> HADFIELD, Grant Gordon m on 17.10.1975 to SEWELL, Alison Mary
  b 04.04.1953
  b ** ** ****
  Divorced. Address: 35 Paradise Place, Palmerston North.
  Grant farmed at Mataroa, Taihape for a number of years. He was also a representative with Octopus
  Group, publishers and is now manager for Manawatu A&P Association. He is also a wine tasting
  enthusiast.
  01> HADFIELD, Rebecca Jane
  b 07.12.1977
  Rebecca b. at Paraparaumu. She is completing a degree in Business Studies majoring in Human
  Resource Management at Massey University.
  02> HADFIELD, Cameron William
  b 03.04.1980
  Cameron b. at Wanganui. He is a student at Palmerston North Boys' High School,
